import axios from "axios";

export async function Get(url, params) {
    try {
        await axios.get(url, { params }).then((data) => {
            if (data && data.status === 200)
                return data.data;
        })
    }
    catch (e) {
        return (e);
    }
}

export async function Post(url, obj) {
    try {
        await axios.post(url, obj).then((data) => {
            if (data && data.status === 200)
                return data.data;
        })
    }
    catch (e) {
        return e;
    }
}
